import { BrowserRouter as Router, Route, Routes, BrowserRouter } from 'react-router-dom'

function App(){
  <BrowserRouter>
    <Routes>
      <Route path='/' element={<h2>home page</h2>}/>
    </Routes>
  </BrowserRouter>
}


export default App;







